import React from 'react';
import styled from 'styled-components';

const Img=styled.img`
  object-fit:cover;
  width:100%;
  height:100%;
  border-radius:50%;
`
const Div=styled.div`
  padding: 0 4px;
  height:122px;
  text-align:center;
`
const Span=styled.span`
  position:absolute;
  width:66px;
  height:66px;
  border:solid 3px transparent;
  background-image: linear-gradient(to right, red 0%, orange 100%);
  border-image-slice: 1;
  overflow:hidden;
  border-radius:50%;
`
const Name=styled.div`
  font-size:12px;
  color:#262626;
  overflow:hidden;
  margin-top:5px;
  text-overflow:ellipsis;
  postion:absolute;
  bottom:5px;
`
function StoryEle() {
  return (
   <Div>
      <Span>
          <Img src='images/activeStatus/photo.png'/>
      </Span>
      <Name>growing_beomeo</Name>
   </Div>
  );
}

export default StoryEle;
